import {
  Navbar,
  BigSidebar,
  FlashSales,
} from './components';
import { Hero } from './pages/Dashboard';
import { iphones } from './components/Data';
import Card from './components/Card';

function App() {
  return (
    <>
    <Navbar/>
    <BigSidebar images={iphones}/>
    <FlashSales/>
    <Card/>
    </>

  );
}

export default App;
